x_data = []
    y_data = []
    for i, d in enumerate(activities):
        if type(d) != datetime:
            raise TypeError

        dow = d.strftime('%A')
        if dow in x_data:
            y_data[x_data.index(dow)] += 1
        else:
            x_data.append(dow)
            y_data.append(1)

    plt.bar(x_data, y_data, width=0.5, label="Activities")
    plt.xlabel("Day of the Week")
    plt.ylabel("Number of Activities")
    plt.title("Weekly Activity")
    return plt.gca()

try:
        if activities is None or not all([isinstance(activity, datetime) for activity in activities]):
            raise TypeError
    except TypeError:
        print("Error: activities must be a list of datetime objects")
    else:
        activities.sort(key=lambda activity: activity.weekday())
        count = defaultdict(int)
        for activity in activities:
            count[activity.weekday()] += 1
        plt.bar(['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'],
                [count[day] for day in range(7)], width=0.4, align='center')
        plt.xlabel('Day of the Week')
        plt.ylabel('Number of Activities')
        plt.title('Weekly Activity')
        plt.xticks(rotation=30, fontsize=8)
        return plt.gca()
